  false,\n\t\"url\": null,\n\t\"notes\": \"This dataset contains crab data from a
  field survey of Chionoecetes bairdi and C. opilio collected at six designated index
  sites in the Bering Sea during the 2014 and 2015 NOAA/NMFS/AFSC/RACE crab-groundfish
  bottom trawl surveys of the eastern Bering Sea. Each of the six index sites were
  made up of approximately 10 survey stations and chosen based on historical incidences
  of the parasite Hematodinium sp., the causative agent of Bitter Crab Syndrome (BCS).
  Crab collected at each survey station were preserved and tested in a laboratory
  with a DNA test for the presence of Hematodinium sp. parasite DNA to evaluate any
  changes in intensity of disease within the index sites that may provide information
  as to how the disease is moving or changing within EBS crab populations. The data
  includes sampling year, index site, species, crab morphometrics, Hematodinium sp.
  parasite presence/absence based on PCR assay results.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
